contracts/PlaneTicket.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

contract PlaneTicket {
    address payable public ticketHolder;
    enum Statuses { Available, Taken } 
    Statuses public currentStatus;

    // In versions of Solidity 0.7.0 and later, the `constructor` is not required to be marked as `public`
    constructor() {
        ticketHolder = payable(msg.sender); // `payable` keyword added to make the address `payable`
        currentStatus = Statuses.Available;
    }

    function bookTicket() external payable {
        require(currentStatus == Statuses.Available, "Seat is taken.");
        currentStatus = Statuses.Taken;
        ticketHolder.transfer(msg.value); // Safe to do since msg.value would be non-zero for payable function
    }
}

